--------------------------------------------------------
--  DDL for Procedure GETDBUSERBYUSERID
--------------------------------------------------------
set define off;

  CREATE OR REPLACE PROCEDURE "GETDBUSERBYUSERID" (
	   p_userid IN DBUSER.USER_ID%TYPE,
	   o_username OUT DBUSER.USERNAME%TYPE,
	   o_createdby OUT  DBUSER.CREATED_BY%TYPE,
	   o_date OUT DBUSER.CREATED_DATE%TYPE)
IS
BEGIN
 
  SELECT USERNAME , CREATED_BY, CREATED_DATE
  INTO o_username, o_createdby,  o_date 
  FROM  DBUSER WHERE USER_ID = p_userid;
 
END;

/

--------------------------------------------------------
--  DDL for Procedure GETEMPLOYEEINFO
--------------------------------------------------------
set define off;

  CREATE OR REPLACE PROCEDURE "GETEMPLOYEEINFO" 
   (EMP_NAME OUT VARCHAR,EMP_AGE OUT NUMBER,  EMP_ID IN NUMBER) AS
BEGIN
   SELECT NAME,AGE INTO EMP_NAME, EMP_AGE   FROM Employee e
   WHERE e.ID = EMP_ID;
END;

/

--------------------------------------------------------
--  DDL for Procedure INSERTDBUSER
--------------------------------------------------------
set define off;

  CREATE OR REPLACE PROCEDURE "INSERTDBUSER" (
	   p_userid IN DBUSER.USER_ID%TYPE,
	   p_username IN DBUSER.USERNAME%TYPE,
	   p_createdby IN DBUSER.CREATED_BY%TYPE,
	   p_date IN DBUSER.CREATED_DATE%TYPE)
IS
BEGIN
 
  INSERT INTO DBUSER ("USER_ID", "USERNAME", "CREATED_BY", "CREATED_DATE") 
  VALUES (p_userid, p_username,p_createdby, p_date);
 
  COMMIT;
 
END;

/

--------------------------------------------------------
--  DDL for Procedure PRO_SELECT_DBUSER_INFO
